pragma solidity >=0.7.0 <0.9.0;
contract BusinessConsensus3{
    // This declares a new complex type which will
    // be used for variables later.
    // It will represent a single voter.
    struct Voter {
        bool voted;  // if true, that person already voted
        bool vote;   //represents approval or disapproval
        address recipient; // represents a stakeholder recipient
    }
    // This is a type for a single proposal.
    struct Proposal {
        uint256 voteCount; // number of accumulated votes
        uint256 expiryDate; //expiry date
        uint256 BusinessRequirement;
    }

    mapping(string=>Proposal) public businessProposals;
    mapping(string=>address) public initiators;
    mapping(string =>string) public IDs;
    mapping(string => uint256) public expiryLengths;
    mapping(string => bytes32) public contents;
    mapping(string => uint256) public numApprovals;
    mapping(string => string) public messageDates;
    mapping(string => bytes32) public finalVerdicts;
    mapping(string => bool) public isCompiled;
    mapping(string => string) public subjects;
    mapping(string=>mapping(address=>Voter)) public voter_maps;
    mapping(string=>Voter[]) public Voters;
    mapping(string=>address[]) public keys;
    
    function createContract(string memory _messageID, uint256 expiry, uint256 requiredPercentage,bytes32 _contents,string memory subject,string memory _messageDate) external{
        // initialize proposal set by the original sender and counted votes to zero
        require(initiators[_messageID] == address(0),"Proposal already created!");
        Proposal memory proposal = Proposal({
                voteCount: 0,
                expiryDate : block.timestamp + expiry,
                BusinessRequirement : requiredPercentage
            });
            IDs[subject] = _messageID;
            isCompiled[_messageID] = false;
            finalVerdicts[_messageID] = "Rejected";
            expiryLengths[_messageID] = expiry;
            expiryLengths[subject] = expiry;
            contents[_messageID] = _contents;
            contents[subject] = _contents;
            subjects[_messageID] = subject;
            messageDates[_messageID] = _messageDate;
            numApprovals[_messageID] = 0;
            initiators[_messageID] = msg.sender;
            initiators[subject] = msg.sender;
            businessProposals[_messageID] = proposal;
            businessProposals[subject] = proposal;

    }
    function getIsCompiled(string calldata _messageID) public view returns (bool){
        return isCompiled[_messageID];
    }
    function checkConsistency(string memory _subject, uint256 _businessRequirement, uint256 _expiryLength, bytes32 _contents) public view returns(bool, bool, bool){
        require(msg.sender == initiators[_subject], "You aren't Initiator");
        bool value1 = true;
        bool value2 = true;
        bool value3 = true;
        if(initiators[_subject] == address(0)){
            return (true, true, true);
        }
        else{
            if(_businessRequirement != businessProposals[_subject].BusinessRequirement){
                value1 = false;
            }
            if(_contents != contents[_subject]){
                value2 = false;
            }
            if(expiryLengths[_subject] != _expiryLength){
                value3 = false;
            }
        return (value1,value2,value3);
        }
    }
    function getIsCreated(string calldata subject) public view returns (string memory,Proposal memory){
        return (IDs[subject],businessProposals[subject]);
    }
    // Give `voter` the right to vote in this proposal.
    // May only be called by `initiator`.
    function RegisterVoter(address voter,string calldata _messageID) external {
        // only initiator can register a recipient in the voting process
        require(
            msg.sender == initiators[_messageID],
            "Only initiator can register a recipient."
        );
        require(voter != initiators[_messageID], "Initiator can't vote!");

        require(voter_maps[_messageID][voter].recipient == address(0), "Recipient is already registered");

        require(block.timestamp < businessProposals[_messageID].expiryDate, "Proposal has reached its expiry date");

        Voter memory x = Voter({voted: false,recipient: voter, vote: false});
        voter_maps[_messageID][voter] = x;
        keys[_messageID].push(voter);
    }

    function Vote(string memory response,string calldata _messageID) external {

        require(block.timestamp < businessProposals[_messageID].expiryDate, "Voting has expired");
        require(voter_maps[_messageID][msg.sender].recipient != address(0x0), "You are not registered to vote");
        require(!voter_maps[_messageID][msg.sender].voted, "You already sent a response.");

        if(keccak256(bytes(response)) == keccak256(bytes("i approve"))){
            voter_maps[_messageID][msg.sender].voted = true;
            voter_maps[_messageID][msg.sender].vote = true;
            numApprovals[_messageID] += 1;
            businessProposals[_messageID].voteCount += 1;
            Voters[_messageID].push(voter_maps[_messageID][msg.sender]);
        }

        else if(keccak256(bytes(response)) == keccak256(bytes("i disapprove"))){
            voter_maps[_messageID][msg.sender].voted = true;
            businessProposals[_messageID].voteCount += 1;
            Voters[_messageID].push(voter_maps[_messageID][msg.sender]);
        }
        //if given invalid response, it will be considered a disapproval
        else{
            voter_maps[_messageID][msg.sender].voted = true;
            businessProposals[_messageID].voteCount += 1;
            Voters[_messageID].push(voter_maps[_messageID][msg.sender]);
        }
        
    }

    /// compile all relevant information into a Bundle
    function Consensus(string calldata _messageID) external {
        require(block.timestamp >= businessProposals[_messageID].expiryDate, "Verdict has not been reached yet");
        require(isCompiled[_messageID] == false, "Consensus has already been calculated");
        require(msg.sender == initiators[_messageID] || voter_maps[_messageID][msg.sender].recipient != address(0x0), "You aren't authorize to compile Bundle");
        uint256 AccumulatedPercentage = (numApprovals[_messageID]/keys[_messageID].length)*100;
        if(AccumulatedPercentage >= businessProposals[_messageID].BusinessRequirement){
            finalVerdicts[_messageID] = "Accepted";
        }
        for(uint8 i=0; i< keys[_messageID].length; i++){
            if(voter_maps[_messageID][keys[_messageID][i]].voted == false){
                Voters[_messageID].push(voter_maps[_messageID][keys[_messageID][i]]);
            }
        }
        isCompiled[_messageID] = true;
    }

    function retrieve_bundle(string calldata _messageID) external view returns (bytes32, string memory, uint256, Voter[] memory){
        require(block.timestamp >= businessProposals[_messageID].expiryDate, "Verdict has not been reached yet");
        Voter[] memory voters = Voters[_messageID];
        bytes32 verdict = finalVerdicts[_messageID];
        uint256 count = businessProposals[_messageID].voteCount;
        return (verdict,_messageID,count,voters);
        
    }

}

